Text:
*hoofclaps for @mlp_UnGooseAlt!*

*carefully hides the bag of bits that she's won betting on the goose to win top 3* &lt;.&lt; &gt;.&gt;

#RotL21

@MLP_Birdcat @mlp_Jetflight *keeps forgetting the #RotL21 thing!*

*definitely doesn't forget the brownies that @mlp_Fluttershy ordered for her though!*

*noms*

*giggles loudly* Ooh there's the Gigglesnort Sprinkles! And what's this... *blinks*

*spits out some fire, grabbing a pitcher of water and dunking her head into it, steam rising up from the pitcher*

*swings her soaking head out of the water and grins at @mlp_Chrysalis* Golly! &gt;&gt;

&lt;.&lt;
&gt;.&gt;
Something feels...off, and not the bad off!

Whaaaaaaaa- *her jaw drops as she skims the morning treat list* Somepony wants chocolate dipped PICKLES?! 
*Pinkie gasps*
@mlp_GummyGator, stop kumquatting the pickle barrels!

*squeaks at @mlp_Yaretzi*

*but not like @mlp_Noxavian. More like a hyena*

EeeeeEEEEE!!!!! *smiles REALLY big as she starts tossing &gt;&gt;
